import React, { useEffect, useState } from 'react';
import api from '../api/axios';

const Employees = () => {
  const [employees, setEmployees] = useState([]);
  const [form, setForm] = useState({
    firstName: '',
    lastName: '',
    position: '',
    salaryBase: ''
  });
  const [error, setError] = useState('');

  const loadEmployees = async () => {
    const { data } = await api.get('/employees');
    setEmployees(data.employees || []);
  };

  useEffect(() => {
    loadEmployees();
  }, []);

  const handleChange = (event) => {
    setForm({ ...form, [event.target.name]: event.target.value });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    setError('');
    if (!form.firstName || !form.lastName || !form.position || !form.salaryBase) {
      setError('All fields are required.');
      return;
    }
    try {
      await api.post('/employees', {
        ...form,
        salaryBase: Number(form.salaryBase)
      });
      setForm({ firstName: '', lastName: '', position: '', salaryBase: '' });
      loadEmployees();
    } catch (err) {
      setError(err.response?.data?.message || 'Unable to add employee');
    }
  };

  return (
    <div className="page">
      <div className="page-header">
        <div>
          <h2>Employees</h2>
          <p className="muted">Add and manage staff information.</p>
        </div>
      </div>

      <div className="grid-two">
        <div className="card">
          <h3>Add employee</h3>
          <form onSubmit={handleSubmit}>
            <label>
              First name
              <input
                name="firstName"
                value={form.firstName}
                onChange={handleChange}
                placeholder="Aziz"
              />
            </label>
            <label>
              Last name
              <input
                name="lastName"
                value={form.lastName}
                onChange={handleChange}
                placeholder="Bek" 
              />
            </label>
            <label>
              Position
              <input
                name="position"
                value={form.position}
                onChange={handleChange}
                placeholder="Accountant"
              />
            </label>
            <label>
              Base salary
              <input
                name="salaryBase"
                value={form.salaryBase}
                onChange={handleChange}
                type="number"
                placeholder="4500000"
              />
            </label>
            {error && <div className="form-error">{error}</div>}
            <button className="btn primary" type="submit">
              Save employee
            </button>
          </form>
        </div>

        <div className="card">
          <h3>Current employees</h3>
          <div className="table">
            <div className="table-row table-head">
              <span>Name</span>
              <span>Position</span>
              <span>Base salary</span>
            </div>
            {employees.map((employee) => (
              <div key={employee._id} className="table-row">
                <span>{employee.firstName} {employee.lastName}</span>
                <span>{employee.position}</span>
                <span>{employee.salaryBase}</span>
              </div>
            ))}
            {!employees.length && <div className="muted">No employees yet.</div>}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Employees;
